import React from "react";
import { Link } from "react-router-dom";
import Nav from "../Nav/Nav";

const Expense = () => {
  return (
    <>
      <Nav />
      <Link to={"/"}>Home</Link>
      <Link to={"/navbar"}>Navbar</Link>
    </>
  );
};

export default Expense;
